import React, { Component } from 'react'
import { UserContext } from './userContext'

function ComponentF (){
        return (
            <UserContext.Consumer>
                {
                    (username)=>{
                    return <div> hello gandu {username}</div>
                    }
                }
            </UserContext.Consumer>
        )
}

export default ComponentF
